import React, { Component } from 'react';

class Login extends Component {
  state = {
    caseRef: null,
    password: null
  };

  handleChange = evt => {
    this.setState({ [evt.target.name]: evt.target.value});
  }

  render() {
    return (
      <div>
        <form onSubmit={this.handleSubmit}>
          <input type="text" name="caseRef" value={this.state.caseRef} onChange={this.handleChange} placeholder="Case Reference" id="caseRef" />
          <input type="password" name="password" value={this.state.password} onChange={this.handleChange} placeholder="Password" id="password" />
        </form>
      </div>
    );
  }
}

export default Login;
